import React from 'react';
import './Footer.css';

const Footer: React.FC = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="ad-placeholder">Ad Placeholder</div>
        <div className="ad-placeholder">Ad Placeholder</div>
        <div className="ad-placeholder">Ad Placeholder</div>
        <div className="ad-placeholder">Ad Placeholder</div>
      </div>
    </footer>
  );
};

export default Footer;
